import './ExpenseItem.css'


function ExpenseDate(props) {

   

  

    return (
        <div className="expense-item">
            <div>{props.month } </div>
            <div>{props.day},</div>
            <div>{props.year}</div>
           

            
        </div>

    )
}

export default ExpenseDate;
